import React from "react";
import "./case.css";
import cateimg1 from "../../assets/images/people-learning.jpg";
import cateimg2 from "../../assets/images/close-up-colleagues-learning-job.jpg";
import cateimg3 from "../../assets/images/manager-speaks-phone-while-analyzing-some-graphics-monitor-two-screens.jpg";
import cateimg4 from "../../assets/images/rear-estate-agent-young-couple-going-through-housing-plans-touchpad-while-having-meeting-home.jpg";
import cateimg5 from "../../assets/images/people-learning.jpg";
import cateimg6 from "../../assets/images/people-learning.jpg";

const Case = () => {
  return (
    <>
      <div className="case">
        <div className="case-top">
          <div className="bar-red"></div>
          <span>CASE STUDIES</span>
          <div className="bar-red"></div>
        </div>
        <div className="case-heading">
          <h2>
            We serve the best works <br /> view the <span>Case study</span>
          </h2>
        </div>
        <div className="case-category">
          <Cate btn="Coaching" />
          <Cate btn="Strategy" />
          <Cate btn="Faculies" />
          <Cate btn="All Items" />
        </div>
        <div className="case-card-continer">
          <CateCard
            CateImg={cateimg1}
            topic=". Consulting"
            heading="Consulting for business Organizations"
          />
          <CateCard
            CateImg={cateimg2}
            topic=". Consulting"
            heading="Consulting for business Organizations"
          />
          <CateCard
            CateImg={cateimg3}
            topic=". Consulting"
            heading="Consulting for business Organizations"
          />
          <CateCard
            CateImg={cateimg4}
            topic=". Consulting"
            heading="Consulting for business Organizations"
          />
          <CateCard
            CateImg={cateimg5}
            topic=". Consulting"
            heading="Consulting for business Organizations"
          />
          <CateCard
            CateImg={cateimg6}
            topic=". Consulting"
            heading="Consulting for business Organizations"
          />
        </div>
      </div>
    </>
  );
};
export default Case;

function Cate(props) {
  return (
    <>
      <button className="primary-btn discover category">{props.btn}</button>
    </>
  );
}

function CateCard(props) {
  return (
    <>
      <div className="cate-card">
        <img src={props.CateImg} alt="" />
        <div className="case-study-box">
          <div className="box-text">
            <span>{props.topic}</span>
            <h5>{props.heading}</h5>
          </div>
        </div>
      </div>
    </>
  );
}
